import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Login from './Login';
import Home from './Home';

function App() {
  return (
    <Router>
      <div>

          <Route exact path="/login" component={Login} />
          <Route path="/home" component={Home} />

      </div>
    </Router>
  );
}

export default App;
